import { css } from '@emotion/css';

export const styContainer = css`
  overflow: scroll;
  height: calc(100vh - 35px);
  display: flex;
  flex-direction: column;
  justify-content: space-between;
`;

export const styTitle = css`
  font-family: 'Poppins', sans-serif;
  font-weight: 600;
  font-size: 35px;
`;
